CREATE PROCEDURE sp_AddNewBook (@title VARCHAR(324),
							    @author VARCHAR(456),
							    @isbn VARCHAR(13),
							    @published_date DATE,
							    @genre VARCHAR(50),
							    @shelf_location INT,
							    @current_status VARCHAR(10))
AS BEGIN
	INSERT INTO books (title, author, isbn, published_date, genre, shelf_location, current_status)
	VALUES (@title, @author, @isbn, @published_date, @genre, @shelf_location, @current_status)
END
